import React, {Component} from 'react';
import Tilt from 'react-parallax-tilt';

const Logo = () => {
    return (
        <div className= "ma4 mt0">
           <Tilt
    className="tilt-img"
    tiltMaxAngleX={35}
    tiltMaxAngleY={35}
    perspective={900}
    scale={1.1}
    transitionSpeed={2000}
    gyroscope={true}
  >
    <img src={imgNyc} className="inner-element" alt="pic" />
  </Tilt>
        </div>
    )
}

export default Logo;
